import { Alert, Button, Grid, Typography } from "@mui/material";
import { Box, Container, Stack } from "@mui/system";
import { LoadingButton } from "@mui/lab";
import React, { useEffect, useState } from "react";
import { useForm } from "react-hook-form";
import apiService from "../app/apiService";
import FormProvider from "../components/form/FormProvider";
import LoadingScreen from "../components/loadingScreen/LoadingScreen";
import ProductFilter from "../features/product/ProductFilter";
import ProductList from "../features/product/ProductList";
import ProductSearch from "../features/product/ProductSearch";
import ProductSort from "../features/product/ProductSort";
import "./storepage.css";
import { getProducts } from "../features/product/productSlice";

import { useDispatch, useSelector } from "react-redux";

function StorePage() {
  const dispatch = useDispatch();
  // const [products, setProducts ] = useState([]);
  // const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");
  const [filterName, setFilterName] = useState("");
  const [page, setPage] = useState(1);

  const { currentPageProducts, productById, isLoading, totalProduct } =
    useSelector((state) => state.product);

  let products = currentPageProducts.map((product) => productById[product]);

  const defaultValues = {
    types: [],
    priceRange: "",
    sortBy: "featured",
    searchQuery: "",
  };

  const methods = useForm({
    defaultValues,
  });

  const { watch, reset } = methods;
  const handleSubmit = (searchQuery) => {
    setPage(1);
    setFilterName(searchQuery);
  };
  useEffect(
    (name) => {
      name = filterName;
      
      setTimeout(() => {
        dispatch(getProducts({ page, name }));
  
      }, 700);
    },
    [page, filterName, dispatch]
  );
const [data, setData] = useState([]);
const [filterTypes, setFilterTypes] = useState(data);
const [loading, setLoading] = useState(false)
  useEffect(() => {
    const getFilterTypes = async () => {
      setLoading(true);
      try {
        const res = await apiService.get(`/products/public`);

        setData(res.data);
        setFilterTypes(res.data)
        setError("");
      } catch (error) {
        console.log(error);
        setError(error.message);
      }
      setLoading(false);
    };
    getFilterTypes();
  }, []);

  const filterProduct = (cat) => {
    const updatedList = data.filter((x)=> x.types === cat);
    setFilterTypes(updatedList);
  }
  console.log("products", products);
  return (
    <Container sx={{ display: "flex", minHeight: "100vh", mt: 3 }}>
      <Button
      onclick={()=>setFilterTypes("Fruit")}
      >
        Types
      </Button>

      <Stack>
        <FormProvider methods={methods}>
          <ProductFilter resetFilter={reset} />
        </FormProvider>
      </Stack>
      
      <Stack sx={{ flexGrow: 1 }}>
        <Stack
          spacing={2}
          direction={{ xs: "column", sm: "row" }}
          alignItems={{ sm: "center" }}
          justifyContent="space-between"
          mb={2}
        >
          <ProductSearch handleSubmit={handleSubmit} />
          <FormProvider methods={methods}>
           <ProductSort/>
          </FormProvider>
         
        </Stack>

        <Box sx={{ position: "relative", height: 1 }}>
          {isLoading ? (
            <LoadingScreen />
          ) : (
            <>
              {error ? (
                <Alert severity="error">{error}</Alert>
              ) : (
                <ProductList products={products} />
              )}
            </>
          )}
        </Box>

        <Box
          sx={{
            mt: { xs: 2, md: 5 },
            mb: { xs: 2, md: 5 },
            display: "flex",
            justifyContent: "center",
          }}
        >
          {totalProduct ? (
            <LoadingButton
              variant="outlined"
              sx={{
                backgroundColor: "#F2C200",
                fontFamily: "Comic Sans MS",
                p: 2,
                fontWeight: "600",
                fontSize: { xs: 15, md: 17 },
                color: "#000",
              }}
              size="small"
              loading={isLoading}
              onClick={() => setPage((page) => page + 1)}
              disabled={
                Boolean(totalProduct) && products.length >= totalProduct
              }
            >
              Load more
            </LoadingButton>
          ) : (
            <Typography variant="h6">No Products Yet</Typography>
          )}
        </Box>
      </Stack>
    </Container>
  );
}

export default StorePage;
